import React from 'react';
import Header from './Header'
import Cards from './Cards';
import Footer from './Footer';
import './App.css';
import './index.css';
import "./Footer";
import {Card} from "react-bootstrap";
import {Button} from "react-bootstrap";


function App() {
  return (
    <div>
    {/*  <header className="App">
        <h2>Eco-Via</h2>
  </header> */}
    <Header></Header>
      <body>

         <form action="#"> 

                    <h1>Cadastre uma avenida</h1>

                    <fieldset>
                      <legend>
                        <h2>Dados da Via</h2>
                      </legend>

                      <div className="field">
                        <label for="name">Nome da Avendida</label> 
                        <input type="text" name="name" placeholder="Digete nome"/>   
                      </div>

                      <div className="field">
                          <label for="number">Extenção por KM</label>
                          <input type="number" name="number" placeholder="Digite exteção por KM"/>
                      </div>

                      <div className="field-goup">

                          <label for="number">Possui Ciclo Faixa? </label>

                          <li className="radio">
                          <input className="S" type="radio" name="existeCicloFaixa" value="option1"/> Sim 
                          <input classeName="N" type="radio" name="existeCicloFaixa"value="option2"/> Não 
                          </li>

                      </div>   

                    </fieldset>

                    <button type="submit">Cadastrar avenida</button>
                </form>


              </body>



 <Footer></Footer>
            </div>
  );
}

export default App;
